-dialyzer({nowarn_function,v_msg_ConnectionRequest/3}).
v_msg_ConnectionRequest(#'ConnectionRequest'{path = F1,
					     headers = F2},
			Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [path | Path])
