-dialyzer({nowarn_function,v_msg_DisconnectRequest/3}).
v_msg_DisconnectRequest(#'DisconnectRequest'{identifiers
						 = F1,
					     subscriptions = F2},
			Path, _) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [identifiers | Path])
